	public int calcIntArraySign(int[] A) {
		if( A == null || A.length == 0 ) {
			throw new RuntimeException("Input array must not be empty.");
		}
		boolean minus=false;
		for(int n: A){
			if( n < 0 ) {
				minus = !minus;
			} else if( n == 0 ) {
				return 0;
			}
		}
		return minus? -1: 1;
	}

	@Test
	public void testCalcIntArraySign() {
		assertEquals(1, calcIntArraySign(new int[] { 1, 2, 3 }));
		assertEquals(-1, calcIntArraySign(new int[] { -1, 2, 3 }));
		assertEquals(1, calcIntArraySign(new int[] { -1, -2, 3 }));
		assertEquals(0, calcIntArraySign(new int[] { -1, 0, 3 }));
		assertEquals(-1, calcIntArraySign(new int[] { -100, Integer.MAX_VALUE }));
		assertEquals(1, calcIntArraySign(new int[] { 100, Integer.MAX_VALUE }));
	}

	public String findHighCharPair63(String S) {
		Set<Character> set = new HashSet<>(64);

		Optional<Character> max = S.chars()
			.mapToObj(c -> (char) c)
			.filter(c->{
				if( set.contains(c) ) {
					return false;
				}
				set.add(c);
				return set.contains(Character.toUpperCase(c)) &&  set.contains(Character.toLowerCase(c));
			})
			.map(c->Character.toLowerCase(c))
			.max((a, b) -> Character.compare(a, b));

		return max.isPresent()?max.get().toString().toUpperCase(): "NO";
	}

	public String findHighCharPair240(String S) {
		boolean[] charset = new boolean[1024];
		
		OptionalInt max = S.chars()
			.parallel()
			.filter(c->charset[c]? false: 
						(charset[c]=true)? charset[Character.toLowerCase(c)] && charset[Character.toUpperCase(c)]: 
							false)
			.map(c->Character.toLowerCase(c))
			.max();
		
		return max.isPresent()?String.valueOf(Character.toUpperCase((char)max.getAsInt())): "NO";
	}

	@Test
	public void testFindHighCharPair() {
		assertEquals("D",findHighCharPair63("aaBabcDad"));
		assertEquals("D",findHighCharPair240("aaBabcDad"));
		assertEquals("B",findHighCharPair63("aaBabcDaA"));
		assertEquals("B",findHighCharPair240("aaBabcDaA"));
		assertEquals("NO",findHighCharPair63(""));
		assertEquals("NO",findHighCharPair240(""));
		assertEquals("NO",findHighCharPair63("Codility"));
		assertEquals("NO",findHighCharPair240("Codility"));
		assertEquals("T",findHighCharPair63("WeTestCodErs"));
		assertEquals("T",findHighCharPair240("WeTestCodErs"));
		assertEquals("Z",findHighCharPair63("WeTestCodErszZ"));
		assertEquals("Z",findHighCharPair240("WeTestCodErszZ"));
	}

